<body>
    <div class="error-wrapper">
        <img src="data:image/png;base64," height="50"/>

        <h1>PHP ERROR</h1>
        <h2>An Error Was Encountered</h2>

        <p>
            <table>
                <?php if(! empty($severity)): ?>
                <tr>
                    <td>Severity</td>
                    <td>:</td>
                    <td><?php echo $severity; ?></td>
                </tr>
                <?php endif; ?>
                <tr>
                    <td>Message</td>
                    <td>:</td>
                    <td><?php echo $message; ?></td>
                </tr>
                <tr>
                    <td>Filename</td>
                    <td>:</td>
                    <td><?php echo $filepath; ?></td>
                </tr>
                <tr>
                    <td>Line Number</td>
                    <td>:</td>
                    <td><?php echo $line; ?></td>
                </tr>
                <?php if(count($backtrace) > 1): ?>
                <tr>
                    <td>Backtrace</td>
                    <td>:</td>
                    <td></td>
                </tr>
                <tr>
                    <td colspan="3">
                        <ol style="margin:1px 15px 15px 15px;">
                            <?php if(isset($backtrace)): ?>
                                <?php foreach ($backtrace->chronology() as $chronology): ?>

                                    <li style="padding-bottom: 5px;">
                                        <?php echo $chronology->call; ?><br>
                                        <?php echo 'File: '.@realpath($chronology->file); ?><br>
                                        <?php echo 'Line: '.$chronology->line; ?>
                                    </li>

                                <?php endforeach ?>
                            <?php endif; ?>
                        </ol>
                    </td>
                </tr>
                <?php endif; ?>
            </table>
        </p>

        <div class="copyright">
